import classes from './MealItem.module.css';

export const MealItem = ({meal}) => {
  const price = `$${meal.price.toFi}`
  return (
    <li className={classes.meal}>
      <div>
        <h3>{meal.name}</h3>
        <div>{meal.description}</div>
        <div>{price}</div>
      </div>
      <div></div>
    </li>
  )
}
